import React, { Children } from 'react'
import cl from './MyInput.module.css'

const MyInput = ({ children, ...props }) => {
    return (
        <input
            type={props.type}
            className={cl.MyInput}
            value={props.value}
            onChange={children}
        />
    )
}

export default MyInput
